import React from "react";
import "../Styles/App.css";
import { Menu, Container } from "semantic-ui-react";
import { Link } from "react-router-dom";

class Navbar extends React.Component {
  state = { activeItem: "home" };

  handleItemClick = (e, { name }) => {
    this.setState({
      activeItem: name,
    });
  };

  render() {
    return (
      <>
        <Container fluid className="transparent">
          <Menu pointing secondary className="menu">
            <div>
              <Link to="/">
                <Menu.Item
                  name="home"
                  active={this.state.activeItem === "home"}
                  onClick={this.handleItemClick}
                  className="menuItem"
                />{" "}
              </Link>

              <Link to="/about">
                <Menu.Item
                  name="about me"
                  active={this.state.activeItem === "about me"}
                  onClick={this.handleItemClick}
                  className="menuItem"
                />{" "}
              </Link>

              <Link to="/projects">
                <Menu.Item
                  name="skills and projects"
                  active={this.state.activeItem === "projects"}
                  onClick={this.handleItemClick}
                  className="menuItem"
                />
              </Link>

              <Link to="/contact">
                <Menu.Item
                  name="contact"
                  active={this.state.activeItem === "contact"}
                  onClick={this.handleItemClick}
                  className="menuItem"
                />{" "}
              </Link>
            </div>
          </Menu>
        </Container>
      </>
    );
  }
}

export default Navbar;
